In a BIG but mostly non-Halloween-related podcast, T. K. Sivgin and I continue our rambling discussion of the computer games that shaped our lives. Games discussed include El-Fish, Paraworld, Star Trek: The Next Generation – A Final Unity, the Oddworld Franchise, Tomb Raider, the Total War Series, Donkey Kong Country Returns, among many others - as well as the incredible power that is childhood imagination!
